import styled from 'styled-components'

export const MessageListPanelWrapper = styled.div`
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  position: absolute;
  z-index: 50;
  -webkit-background-size: contain;
  -moz-background-size: contain;
  -o-background-size: contain;
  background-size: contain;
  object-fit: contain;
  min-width: 500px;
`
